<p>I have this query that tells me if there was a message in a certain period from a determined user:</p>
<pre class="lang-sql prettyprint-override"><code>SELECT CASE WHEN count(1) = 0 THEN false ELSE true END AS 'value'
FROM messages m
WHERE m.time BETWEEN 0 AND 1652471890 AND m.user_id = '256f5280-fb49-4ad6-b7f5-65c4329d46e0';
</code></pre>
<p>Currently I am trying to do this to count the amount and emit a custom value 0/1:</p>
<p><strong>Current MongoDB Aggregate</strong></p>
<pre class="lang-js prettyprint-override"><code>    db.messages.aggregate([
        { $match: 
            {
            $and: [
              {user_id: &quot;256f5280-fb49-4ad6-b7f5-65c4329d46e0&quot;},
              {time: {$gt: 1622471890, $lt: 1822471890}}
            ]
            } 
        },
        { $count: &quot;value&quot;}
    ])
</code></pre>
<p><strong>Dataset:</strong></p>
<pre class="lang-json prettyprint-override"><code>    [
    {
        &quot;time&quot;: 1422471890,
        &quot;user_id&quot;: &quot;256f5280-fb49-4ad6-b7f5-65c4329d46e0&quot;,
        &quot;message&quot;: &quot;This is an example of my db&quot;
    },
    {
        &quot;time&quot;: 1622471890,
        &quot;user_id&quot;: &quot;256f5280-fb49-4ad6-b7f5-65c4329d46e0&quot;,
