        &quot;message&quot;: &quot;This is an example of my db (4)&quot;
    }
    ]
</code></pre>
<p><strong>Return:</strong></p>
<p>With this dataset it's returning:</p>
<p><code>{ &quot;value&quot; : 2 }</code></p>
