MongoDB Update a document's key when another document is updated<p>I am using Express.js, Node.js, MongoDB, and Mongoose stack</p>
<p>I have three documents in the database which are Warehouses, Inventories, and Items.</p>
<p>A Warehouse has one Inventory, and each Inventory is assigned to a Warehouse.
An Inventory contains many Items.</p>
<p><code>items.model.js</code></p>
<pre><code>const mongoose = require('mongoose');

const itemSchema = new mongoose.Schema({
    name:{
        type: String
    },
    dateCreated:{
        type: Date,
        default: Date.now()
    },
    price:{
        type:Number
    },
    type:{
        type:String
    },
    category:{
        type:String
    },
    description:{
        type: String
    },
    picture:{
        type: String
    }
})
const Item = mongoose.model('item',itemSchema)
module.exports.Item=Item
module.exports.itemSchema = itemSchema
</code></pre>
<p><code>inventories.model.js</code></p>
<pre><code>const mongoose = require('mongoose');
const itemSchema = require('../items/items.model').itemSchema;

const inventorySchema = new mongoose.Schema({
    name:{
        type: String,
        unique: true
    },
    dateCreated:{
        type: Date
    },
    items:{
        type:[itemSchema]
    }
})
const Inventory = mongoose.model('inventory',inventorySchema)
module.exports.inventorySchema=inventorySchema;
module.exports.Inventory=Inventory;
</code></pre>
<p><code>warehouses.model.js</code></p>
<pre><code>const mongoose = require('mongoose');
const inventorySchema = require('../inventories/inventories.model').inventorySchema
const warehouseSchema = new mongoose.Schema({
    name:{
        type:String
    },
    location:{
        type:String
    },
    inventory:{
        type:inventorySchema
    },
    dateCreated:{
        type:Date,
        default:Date.now()
    },
    numberOfEmployees:{
        type:Number
    }
})
const Warehouse = mongoose.model('warehouse',warehouseSchema)
module.exports.Warehouse=Warehouse
</code></pre>
<p>I have an endpoint which assigns an Inventory to a Warehouse based on the Inventory's name. I also have an endpoint that adds an Item to an Inventory</p>
<p><code>warehouses.controller.js</code></p>
<pre><code>/**
 * 
 * Assign an inventory to warehouse based on
 * Warehouse (id), inventory (name)
 */
const assignInventory = () =&gt; async (req, res) =&gt; {
    try {
        const inventoryName = req.body.inventory
        const inventoryDoc = await Inventory.findOne({ name: inventoryName })
        if (!inventoryDoc) {
