<p><code>Executor error during find command :: caused by :: Sort exceeded memory limit of 33554432 bytes, but did not opt in to external sorting. Aborting operation. Pass allowDiskUse:true to opt in.</code></p>
<p>My Axios get request looks like:</p>
<pre><code>    for (let i = 0; i &lt; total; i++) {
      await axios({
        method: &quot;GET&quot;,
        url: &quot;/api/entries/&quot;,
        params: { from: index + i, _limit: 1 },

      })
        .then((res) =&gt; {
          setPics((prev) =&gt; {
            return [...new Set([...prev, ...res.data])];
          });
          setIndex((prev) =&gt; prev++)
          setMoreEntries(res.data.length &gt; 0)
        })

    }
</code></pre>
<p>and in my controller my GET function looks like:</p>
<pre><code>const getEntries = asyncHandler(async (req, res) =&gt; {
