<p>Everything works perfectly until about half the entries have loaded, then it breaks. I thought adding <code>allowDiskUse(true)</code> would fix it, but same result.</p>
<p>Edit: I should mention, if I take out <code>.sort({ createdAt: 'desc' })</code> it works perfectly, but loads in the opposite order.</p>

